  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Benton Lake,
  Willow Creek, Pishkun National Wildlife Refuge outlines Refuge accomplishments from
  May to August of 1960. The report begins by summarizing the weather conditions,
  habitat conditions, water conditions, and food and cover during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, predators,
  rodents, and mammals- is also covered. The Refuge development and maintenance section
  discusses physical developments, collections and receipts, and prescribed burning.
  Resource management is outlined; topics include grazing and haying. The public relations
  section of the report describes recreational uses, Refuge participation, and safety.
  Photographs and items of interest are attached.\",\n\t\"license_title\": \"License
